import React from 'react';
import "./styles.css"

function header() {
  return (
    <header>
        <div className='name'>
            <h1>Thiago Martins</h1>
        </div>
        <div className='routes'>
            <a href="">Home</a>
            <a href="">Sobre Mim</a>
            <a href="">Projetos</a>
        </div>
    </header>
  );
}

export default header;
